import './LandingHeader.css'

const LandingHeader = () => {
    return(
      <header className='landingheader'>
        <div className='contents'>
          <h2 className='title'>
              JAYCO
          </h2>
        </div>
      </header>
  
    )
  }
  
  export default LandingHeader;
